import React from "react";

const style = {
   width: "250px",
   height: "50px",
   position: "absolute",
   top: "50%",
   transform: "transalateY(50%)",
   margin: "0 auto",
};

const ErrorHint = ({ hintText }) => {
   return <div style={style}>{hintText}</div>;
};

export default ErrorHint;
